    data: |
      SELECT - COUNT ( * ) * - COALESCE ( - 55, + COUNT ( * ) + - - 66 / + 1, - 56 * - - 97 + - + MAX ( DISTINCT - 31 ) ) AS col0, + 17 * + + COUNT ( * );

outputs:
  - name: q4123.out
    data: |
      -55	17
